import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();

    this.state = {veggies: [
                  {
                    name: 'Carrot'
                  },
                  {
                    name: 'Squash'
                  },
                  {
                    name: 'Zucchini'
                  }
                ]};
  }

  render(){
    return (
      <div className="App">
        {
          this.state.veggies.map(veggie => <h1>{veggie.name}</h1>)
        }
      </div>
    );
  }
}

export default App;
